import ReactDOM from 'react-dom';
import React from 'react';

var Header = React.createElement("h1", null, "Hello React");
const Description = React.createElement("p", null, "React is super fun!");
const Whatever = React.createElement("div", null, {className:"jumbostron"}, Header, Description);

const App = (props) => {
    return React.createElement("div", {className:"jumbptron"},
    React.createElement("h1", null,`Hello ${props.name}`),
    React.createElement("p", null, `${props.name} is ${props.description}`)
    );
}
ReactDOM.render(App({name:"React", description: " a cool JS library"}), document.getElementById("root"));
